function Progress({ totalPoints, numberOfQuestions, index, points }) {
  return (
    <header className="progress">
      <progress max={numberOfQuestions} value={index + Number()} />
      <p>
        Question
        <strong>
          {index + 1}/{numberOfQuestions}
        </strong>
      </p>

      <p>
        <strong>
          {points}/{totalPoints}
        </strong>
      </p>
    </header>
  );
}

export default Progress;
